/* _demo\src\pages\ReglesInterfaces.svelte generated by Svelte v3.50.1 */function create_fragment$4(ctx){let h1;let t1;let p0;let t3;let utd_accordeon0;let t37;let utd_accordeon1;let t53;let utd_accordeon2;let t76;let p20;let t79;let p21;return{c(){h1=element("h1");h1.textContent="Règles d'interfaces";t1=space();p0=element("p");p0.textContent="Tous les sites Web développés au sein du ministère de l'Emploi et de la Solidarité sociale doivent être conformes à ces standards du gouvernement :";t3=space();utd_accordeon0=element("utd-accordeon");utd_accordeon0.innerHTML=`<p>Toutes les communications du gouvernement, des ministères et des organismes gouvernementaux sont soumises aux normes graphiques du PIV : <a href="https://www.piv.gouv.qc.ca" target="_blank">www.piv.gouv.qc.ca</a></p> \n\n    <h3 class="svelte-uf8bgz">PIV standard</h3> \n    <p>Tous les sites Web gouvernementaux doivent être identifiés à l&#39;aide d&#39;un bandeau d&#39;en-tête et/ou d&#39;un pied de page, qu&#39;ils servent à des fins informationnelles, transactionnelles ou promotionnelles et qu&#39;ils soient destinés au grand public (site Internet), à une clientèle interne (intranet) ou à une clientèle externe spécifique (extranet).</p> \n    <p>Voir les composants <a href="/composants/entetepiedpage/piventete">entête</a> et <a href="/composants/entetepiedpage/pivpiedpage">pied de page</a> pour les bandeaux PIV.</p>         \n\n    <p>Pour les informations relatives aux éléments qui doivent être présents dans l&#39;entête et le pied de page, se référer à :</p> \n    <ul class="utd"><li>Section 4.4 du <a href="https://www.piv.gouv.qc.ca/fileadmin/documents/guide/section4_numerique.pdf" target="_blank">Guide des normes graphiques du Programme d&#39;identification visuelle</a> (.PDF);</li> \n        <li><a href="https://www.piv.gouv.qc.ca/fileadmin/documents/guide/infos_complementaires.pdf" target="blank">Guide des bonnes pratiques et informations complémentaires au Programme d&#39;identification visuelle</a> (.PDF) (Nouvelle édition, mai 2022).</li></ul> \n        \n            \n    <h3 class="svelte-uf8bgz">PIV appliqué aux progiciels et applications</h3> \n    <p>Certains sites sont des applications en ligne conçues pour les besoins propres à un groupe ciblé. Lorsque la navigation du site et la mise en page sont intégrées dans une solution logicielle clés en mains, il faut <strong>appliquer le bandeau d&#39;en-tête et le pied de page dans la mesure de ce qui est possible</strong>. Dans les cas où il faut retrancher certains éléments, le positionnement et la grosseur des signatures ne doivent pas être modifiés.</p> \n    <p>Les normes pour les progiciels en ligne qui s&#39;affichent via le navigateur Web se basent généralement sur les normes des sites Web. On peut aussi les adapter, en fonction des limites que l&#39;outil impose aux interfaces.</p> \n    <p>Si possible, apposer le bandeau contenant le logo Québec et y afficher le nom du site (ou du service qui utilise le progiciel). La zone personnalisable peut rester vide.</p> \n    <p>S&#39;il n&#39;est pas possible d&#39;apposer le bandeau, afficher le logo Québec en haut, à gauche, dans toutes les pages du progiciel.</p>`;t37=space();utd_accordeon1=element("utd-accordeon");utd_accordeon1.innerHTML=`<p>Le <a href="https://design.quebec.ca/apercu/systeme" target="_blank">Système de design gouvernemental</a> est le référentiel UX et UI qui s&#39;adresse aux équipes (TI et communications) des ministères et organismes, ainsi qu&#39;aux collaborateurs amenés à travailler avec le gouvernement sur des projets numériques. L&#39;objectif premier est d&#39;assurer la cohérence des interfaces gouvernementales (information et services) afin d&#39;offrir aux citoyennes et citoyens une expérience simplifiée et uniforme.</p> \n    <p>Le système de design regroupe la charte ergonomique et la charte graphique appliquées à un site Web ou une application. Il présente les principes et lignes directrices, les guides de style (couleurs, typographie), les patterns et grilles pour structurer les éléments, une bibliothèque de composants d&#39;interface, le langage visuel (iconographie) et de l&#39;information sur le contenu : principes de rédaction web, langage à adopter, structure du contenu, typographie (utilisation du gras, soulignement, italique), libellés, référencement SEO, etc.</p> \n    <p><strong>L&#39;application stricte du système de design est obligatoire</strong>. Vous devez utiliser la charte graphique et toutes les composantes et règles d&#39;interface tels que décrites dans ce système.</p> \n    <p><strong>Tous nos composants web sont basés sur ce système de design</strong>, et sont accessibles et &quot;responsive&quot;.</p> \n\n    <h3 class="svelte-uf8bgz">Évolution et collaboration</h3> \n    <p>Le système de design est évolutif. Lorsqu&#39;une nouvelle interface est développée, les besoins de styles et de composantes sont identifiés à l&#39;étape des maquettes schématiques. Si les styles et composantes nécessaires à cette interface se trouvent dans le système de design, ils doivent être utilisés. Si les styles ou composantes ne répondent pas tout à fait au besoin, ou n&#39;existent tout simplement pas, les nouvelles composantes doivent être développées par l&#39;équipe UX en collaboration avec la Direction des communications numériques gouvernementales (DCNG).</p>`;t53=space();utd_accordeon2=element("utd-accordeon");utd_accordeon2.innerHTML=`<p>Un contenu ou un service offert sur le Web est considéré comme accessible lorsque toute personne, peu importe ses incapacités, peut le comprendre, y naviguer et interagir avec lui. L&#39;accessibilité Web représente un élément important pour permettre l&#39;intégration sociale et la participation à la vie collective de la population.</p>     \n    <p>Une attention particulière doit être portée lors du développement des interfaces pour y intégrer le Standard du gouvernement du Québec en ressources informationnelles (SGQRI) : <a href="https://www.tresor.gouv.qc.ca/fileadmin/PDF/ressources_informationnelles/AccessibiliteWeb/standard-access-web.pdf" target="_blank">Standard sur l&#39;accessibilité des sites Web (SGQRI 008 2.0)</a> (.PDF).</p> \n    <p>Depuis sa modernisation, en 2018, ce Standard s&#39;appuie sur les <a href="https://www.w3.org/Translations/WCAG20-fr/">Règles pour l&#39;accessibilité des contenus Web 2.0 (WCAG 2.0)</a> recommandées par le World Wide Web Consortium (W3C), qui sont devenues une norme internationale (ISO/IEC 40500:2012). Tout contenu Web doit satisfaire les exigences de conformité prévues dans les WCAG 2.0.</p>     \n    <p>Les composantes développées dans le système de design et les couleurs qui y sont recommandées respectent les principaux standards d&#39;accessibilité.</p> \n          \n    <p>Pour plus d&#39;information, consultez les pages traitant d&#39;accessibilité :</p> \n    <ul><li>dans notre intranet : <a href="https://intranet-mtess.mes.reseau.intra/ressources-services/communications/accessibilite-web/">Accessibilité Web</a>;</li> \n        <li>sur le site du SCT : <a href="https://www.tresor.gouv.qc.ca/ressources-informationnelles/architecture-dentreprise-gouvernementale/standards-et-normes/accessibilite-du-web/" target="_blank">Les standards d&#39;accessibilité du gouvernement du Québec</a>.</li></ul> \n    \n    <p></p>`;t76=space();p20=element("p");p20.innerHTML=`<strong>Ces règles s&#39;appliquent à tous les sites Web</strong>. Pour les sites Web particuliers (intranet, progiciels, sondage, bulletin Web, etc.), ces règles sont aussi une référence, mais ils pourront être traités au cas par cas puisque les règles d&#39;affichage peuvent varier selon le type de plateforme de développement, de service Web et de clientèle.`;t79=space();p21=element("p");p21.innerHTML=`<strong>Tout nouveau site Web qui sera mis en ligne devra respecter ces règles d&#39;interface Web, le PIV et le système de design gouvernemental</strong>. Les sites mis en ligne dans le passé devront appliquer ces règles lors des développements en continuité ou lors de demandes d&#39;amélioration.`;set_custom_element_data(utd_accordeon0,"titre","Programme d'identification visuelle (PIV)");set_custom_element_data(utd_accordeon0,"tag-titre","h2");set_custom_element_data(utd_accordeon0,"class","svelte-uf8bgz");set_custom_element_data(utd_accordeon1,"titre","Système de design gouvernemental");set_custom_element_data(utd_accordeon1,"tag-titre","h2");set_custom_element_data(utd_accordeon1,"class","svelte-uf8bgz");set_custom_element_data(utd_accordeon2,"titre","Standard sur l'accessibilité des sites Web");set_custom_element_data(utd_accordeon2,"tag-titre","h2");set_custom_element_data(utd_accordeon2,"class","mb-32")},m(target,anchor){insert(target,h1,anchor);insert(target,t1,anchor);insert(target,p0,anchor);insert(target,t3,anchor);insert(target,utd_accordeon0,anchor);insert(target,t37,anchor);insert(target,utd_accordeon1,anchor);insert(target,t53,anchor);insert(target,utd_accordeon2,anchor);insert(target,t76,anchor);insert(target,p20,anchor);insert(target,t79,anchor);insert(target,p21,anchor)},p:noop,i:noop,o:noop,d(detaching){if(detaching)detach(h1);if(detaching)detach(t1);if(detaching)detach(p0);if(detaching)detach(t3);if(detaching)detach(utd_accordeon0);if(detaching)detach(t37);if(detaching)detach(utd_accordeon1);if(detaching)detach(t53);if(detaching)detach(utd_accordeon2);if(detaching)detach(t76);if(detaching)detach(p20);if(detaching)detach(t79);if(detaching)detach(p21)}}}class ReglesInterfaces extends SvelteComponent{constructor(options){super();init(this,options,null,create_fragment$4,safe_not_equal,{})}}
